import React from 'react';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

export default function DatePickerExample() {
    return (
        <Grid 
            container 
        >
            <TextField 
                id='date-picker-id'
                defaultValue='2020-12-10'
                label='Birthday'
                InputLabelProps={{
                    shrink: true,
                }}
                type='date'
            />
        </Grid>
    );
}
